(* ### Problem
 In $\triangle{RST}$, shown, $\sin{R}=\frac{2}{5}$.  What is $\sin{T}$?

[asy]
pair R,S,T;
T = (0,0);
S = (2,0);
R = (2,sqrt(21));
draw(R--S--T--R);
draw(rightanglemark(R,S,T,10));
label("$T$",T,SW);
label("$S$",S,SE);
label("$R$",R,NE);
label("$5$",(R+T)/2,NW);
[/asy] The final Answer is 0
 ### Proof
 Because $\triangle RST$ is a right triangle, $\sin R = \frac{ST}{RT}$.
 So $\sin R = \frac{2}{5} = \frac{ST}{5}$. Then $ST=2$.
 We know that $\sin T = \frac{RS}{RT}$.
 By the Pythagorean Theorem, $RS = \sqrt{RT^2 - ST^2} = \sqrt{25-4} = \sqrt{21}$. Then $\sin T = \boxed{\frac{\sqrt{21}}{5}}$.
 *)

theorem
fixes R S T :: real
assumes h0 : "sin R = 2/5"
and h1 : "R + S + T = pi"
shows  "sin T = 0"
 proof- 
  show ?thesis sledgehammer

